CREATE TABLE Ticket (
    Ticket_ID INT PRIMARY KEY,
    TicketNum INT,
    BookingDate DATE,
    SeatNum INT,
    PlatformNum INT,
    Price DECIMAL(7,2),
    BookingStatus VARCHAR(20),
    Schedule_ID INT,
    Passenger_ID INT,
    FOREIGN KEY (Schedule_ID) REFERENCES Schedule(Schedule_ID),
    FOREIGN KEY (Passenger_ID) REFERENCES Passenger(Passenger_ID)
);
